import React from 'react';
import ReactDOM from 'react-dom';
import './index.sass';
import App from './App';
import LoginForm from './Login-Form';
import LoginTable from './Login-Table';
import "bootstrap/dist/css/bootstrap.css";

ReactDOM.render(
  <React.StrictMode>
    <App />
    <LoginForm />
    <LoginTable />
  </React.StrictMode>,
  document.getElementById('root')
);
